pragma solidity ^0.8.4;

import "./Token.sol";

contract Piggybank {
    string public name = "Piggybank";
    Token public token;

    struct Savings {
        uint256 amount;
        uint256 startTimestamp;
        uint256 endTimestamp;
        bool withdrawed;
        bool tokenWithdrawed;
    }

    mapping(address => Savings) public savings;

    constructor(Token _token) {
        token = _token;
    }

    function showData() public view returns (uint256, uint256) {
        Savings storage savedMoney = savings[msg.sender];
        if (!savedMoney.withdrawed) {
            return (savedMoney.amount, savedMoney.endTimestamp);
        } else {
            return (0, 0);
        }
    }

    function payment(uint256 timeToEnd) external payable {
        savings[msg.sender] = Savings(
            msg.value,
            block.timestamp,
            block.timestamp + timeToEnd,
            false,
            false
        );
    }

    function withdraw() external {
        Savings storage savedMoney = savings[msg.sender];
        require(
            savedMoney.endTimestamp <= block.timestamp,
            "Too early to withdraw"
        );
        require(savedMoney.amount > 0, "There is nothing to withdraw");
        require(savedMoney.withdrawed == false, "Money already withdrawed");
        savedMoney.withdrawed = true;
        payable(msg.sender).transfer(savedMoney.amount);
    }

    function withdrawTokens() external {
        Savings storage savedMoney = savings[msg.sender];
        require(
            savedMoney.endTimestamp <= block.timestamp,
            "Too early to withdraw"
        );
        require(
            savedMoney.tokenWithdrawed == false,
            "Tokens already withdrawed"
        );
        require(
            savedMoney.withdrawed == true,
            "First you need to withdraw your ETH"
        );

        uint256 tokenAmount = (savedMoney.amount *
            (savedMoney.endTimestamp - savedMoney.startTimestamp)) / 1000000000;

        // Require that Piggybank has enough tokens
        require(token.balanceOf(address(this)) >= tokenAmount);

        savedMoney.tokenWithdrawed = true;

        // Transfer tokens to the user
        token.transfer(msg.sender, tokenAmount);
    }
}
